.lazy-cascader {
    display: inline-block;
    width: 300px;
    .lazy-cascader-input {
        position: relative;
        width: 100%;
        background: #fff;
        height: auto;
        min-height: 36px;
        padding: 5px;
        line-height: 1;
        cursor: pointer;
        > .lazy-cascader-placeholder {
            padding: 0 2px;
            line-height: 28px;
            color: #999;
            font-size: 14px;
        }
        > .lazy-cascader-label {
            padding: 0 2px;
            line-height: 28px;
            color: #606266;
            font-size: 14px;
            overflow: hidden;
            text-overflow: ellipsis;
            white-space: nowrap;
        }
        > .lazy-cascader-clear {
            position: absolute;
            right: 0;
            top: 0;
            display: inline-block;
            width: 40px;
            height: 40px;
            text-align: center;
            line-height: 40px;
        }
    }
    .lazy-cascader-input-disabled {
        background-color: #f5f7fa;
        border-color: #e4e7ed;
        color: #c0c4cc;
        cursor: not-allowed;
        > .lazy-cascader-label {
            color: #c0c4cc;
        }
        > .lazy-cascader-placeholder {
            color: #c0c4cc;
        }
    }
}
.lazy-cascader-tag {
    display: inline-flex;
    align-items: center;
    max-width: 100%;
    margin: 2px;
    text-overflow: ellipsis;
    background: #f0f2f5;
    > span {
        flex: 1;
        overflow: hidden;
        text-overflow: ellipsis;
    }
    > .el-icon-close {
        -webkit-box-flex: 0;
        -ms-flex: none;
        flex: none;
        background-color: #c0c4cc;
        color: #fff;
    }
}
.lazy-cascader-panel {
    margin-top: 10px;
    display: inline-block;
}
.suggestions-popper-class {
    width: auto !important;
    min-width: 200px;
}
.lazy-cascader-search {
    .empty {
        width: calc(100% - 24px);
        box-sizing: border-box;
        background-color: #fff;
        color: #999;
        text-align: center;
        position: absolute;
        z-index: 999;
        padding: 12px 0;
        margin-top: 12px;
        box-shadow: 0 2px 12px 0 rgba(0, 0, 0, 0.1);
        &:before {
            content: "";
            position: absolute;
            top: -12px;
            left: 36px;
            width: 0;
            height: 0;
            border-left: 6px solid transparent;
            border-right: 6px solid transparent;
            border-top: 6px solid transparent;
            border-bottom: 6px solid #fff;
            filter: drop-shadow(0 -1px 2px rgba(0, 0, 0, 0.02));
        }
    }
}
